DROP TABLE IF EXISTS `zw_m_output_setting`;
CREATE TABLE `zw_m_output_setting` (
  `id` varchar(64) NOT NULL COMMENT '车辆拍照参数设置表主键id',
  `vehicle_id` varchar(64) NOT NULL COMMENT '车辆id',
  `peripheral_id` int(6) NOT NULL COMMENT '外设ID',
  `control_time` int(6) DEFAULT NULL COMMENT '持续时长',
  `outlet_set` int(6) DEFAULT NULL COMMENT '输出口设置',
  `control_subtype` int(6) DEFAULT NULL COMMENT '控制类型（1： io控制 2：油电控制 3：模拟量控制）',
  `analog_output_ratio` float(6) DEFAULT NULL COMMENT '模拟量输出比例',
  `flag` smallint(6) DEFAULT '1',
  `auto_flag` smallint(6) DEFAULT '1' COMMENT '是否是联动策略',
  `create_data_time` datetime DEFAULT NULL,
  `create_data_username` varchar(45) DEFAULT NULL,
  `update_data_time` datetime DEFAULT NULL,
  `update_data_username` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;





